pragma solidity 0.5.1;

contract classroom{

    uint[] registrationNumber;  

    struct student{
        // uint _id;
        uint _regNo;
        string _firstName;
        string _lastName;
    }

    uint256 public studCount = 0;

    mapping(uint => student) public class_CSE;

    function addStudent(uint _regNo, string memory _firstName, string memory _lastName) public{
        registrationNumber.push(_regNo);
        class_CSE[registrationNumber[studCount]] = student(_regNo, _firstName, _lastName);

        studCount += 1;
    }





}
